import React from "react";
import GeneralRequirements from "./GeneralRequirements.tsx";
import Concentrations from "./Concentrations.tsx";

export const CourseMap = () => {
  const listOfDictOfCourses: any[] = [["mse45", ["devices", "cell"]]];
  const courseInfo: any[] = [
    ["mse45", "MSE 45"],
    ["mechec85", "MECHE C85"],
    ["bioe10", "BIOE 10"],
    ["bioe11", "BIOE 11"],
    ["chem3a", "CHEM 3A"],
    ["cs70", "CS 70"],
    ["e7", "E 7"],
    ["cs61a", "CS 61A"],
    ["cs61b", "CS 61B"],
    ["physics7A", "PHYS 7A"],
    ["physics7B", "PHYS 7B"],
    ["math53", "MATH 53"],
    ["math54", "MATH 54"],
    ["math55", "MATH 55"],
    ["eecs16a", "EECS 16A"],
    ["eecs16b", "EECS 16B"],
  ];
  let opaqueList: string[] = [];
  function onMouseOver(courseName: string) {
    for (var i = 0; i < listOfDictOfCourses.length; i++) {
      let course: string;
      let ListOfRelatedClasses: string[];
      [course, ListOfRelatedClasses] = listOfDictOfCourses[i];
      if (courseName === course) {
        opaqueList.concat(ListOfRelatedClasses);
      }
    }
  }
  return (
    <div>
      <div>
        <GeneralRequirements
          className={opaqueList.includes("mse45") ? "circle opaque" : "circle"}
          courseName={"MSE 45"}
          id={"mse45"}
          onMouseOver={() => onMouseOver("mse45")}
        />
        <GeneralRequirements
          courseName={"CS 70"}
          id={"cs70"}
          onMouseOver={() => onMouseOver("cs70")}
        />
        <GeneralRequirements
          courseName={"E7"}
          id={"e7"}
          onMouseOver={() => onMouseOver("e7")}
        />
        <GeneralRequirements
          courseName={"CS 61A"}
          id={"cs61a"}
          onMouseOver={() => onMouseOver("cs61a")}
        />
        <GeneralRequirements
          courseName={"CS 61B"}
          id={"cs61b"}
          onMouseOver={() => onMouseOver("cs61b")}
        />
        <GeneralRequirements
          courseName={"Physics 7A"}
          id={"physics7a"}
          onMouseOver={() => onMouseOver("physics7a")}
        />
        <GeneralRequirements
          courseName={"Physics 7B"}
          id={"physics7b"}
          onMouseOver={() => onMouseOver("physics7b")}
        />
        <GeneralRequirements
          courseName={"Math 55"}
          id={"math55"}
          onMouseOver={() => onMouseOver("math55")}
        />
        <GeneralRequirements
          courseName={"Math 54"}
          id={"math54"}
          onMouseOver={() => onMouseOver("math54")}
        />
        <GeneralRequirements
          courseName={"Math 53"}
          id={"math53"}
          onMouseOver={() => onMouseOver("math53")}
        />
        <GeneralRequirements
          courseName={"EECS 16A"}
          id={"eecs16a"}
          onMouseOver={() => onMouseOver("eecs16a")}
        />
        <GeneralRequirements
          courseName={"EECS 16B"}
          id={"eecs16b"}
          onMouseOver={() => onMouseOver("eecs16b")}
        />
      </div>
      <div className="sub-container">
        <Concentrations
          concentrationName={"Synthetic and Computational Biology"}
          id={"synthetic"}
        />
        <Concentrations
          concentrationName={"Cell & Tissue Engineering"}
          id={"cell"}
        />
        <Concentrations concentrationName={"Devices"} id={"devices"} />
        <Concentrations concentrationName={"Imaging"} id={"imaging"} />
      </div>
    </div>
  );
};
